import React from 'react'


const Skills = (props) => {

    const { SKILL_LIST } = props;

    return (
        <>
            <h2>Skills:</h2>

            {SKILL_LIST.map((skill) => (
                <div key={skill.name}>{skill.name} -
                    points: 0 <button>-</button> <button>+</button>
                    modifier: 0 
                    total: 0
                </div>
            ))}

        </>
    );
}

export default Skills
